import React, { Component } from "react";

const style = {
  container: {
    width: "70%",
    height: 50,
    backgroundColor: "#F5F5F5",
    borderRadius: 10
  }
};

export const TaskDetailContainer = ({ text }) => {
  return (
    <div style={style.container}>
      <p text={this.props.text} />
      <h5 >{'24/03 at 22:45'}</h5>
    </div>
  );
};

export default TaskDetailContainer;
